$(function() {
    {
        var t = $(window),
            e = $(".js-slide"),
            o = $(window).height();
        $(e).height()
    }
    //e.height(o);
    
    var n = !1;
    $(".js-slide").mousewheel(function(t, e) {
        if (!n) {
            n = !0;
            var o = $("body").scrollTop() || $("html").scrollTop(),
                i = $(".js-slide").filter(function() {
                    return 0 > e ? $(this).offset().top > o + 1 : $(this).offset().top < o - 1
                });
            i.length > 0 && (0 > e ? o = i.first().offset().top : e > 0 && (o = i.last().offset().top)), $("html,body").animate({
                scrollTop: o
            }, "easeOutQuint", function() {
                n = !1
            })
        }
        return !1
    }), document.createElement("article"), document.createElement("section"), $('section[data-type="background"]').each(function() {
        var e = $(this);
        $(window).scroll(function() {
            var o = -(t.scrollTop() / e.data("speed")),
                n = "20%" + o + "px";
            e.css({
                backgroundPosition: n
            })
        })
    })
});